import "./FooterStyles.css";
import React from "react";
import {
  FaHome,
  FaPhoneAlt,
  FaMailBulk,
  FaFacebook,
  FaTwitter,
  FaLinkedin,
} from "react-icons/fa";

function Footer() {
  return (
    <React.Fragment>
      <div className="container-fluid bg-black p-5 text-white d-flex justify-content-center align-items-center">
        <div className="row">
          <div className="col-md-6">
            <div>
              <FaHome
                size={20}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              West Melbourne,
              <br />
              <span className="p-5">Florida.</span>
              <br />
              <FaPhoneAlt
                size={20}
                style={{
                  color: "white",
                  marginRight: "1.5rem",
                  marginBottom: "1rem",
                }}
              />
              321-405-4650
              <br />
              <FaMailBulk
                size={20}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              vanim2@gmail.com
            </div>
          </div>
          <div className="col-md-6">
            <p className="display3">Feel free to contact me on social media.</p>
            <div className="m-3">
              <FaFacebook
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaTwitter
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaMailBulk
                size={30}
                style={{ color: "white", marginRight: "1.5rem" }}
              />
              <FaLinkedin size={30} style={{ color: "white" }} />
            </div>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Footer;
